  false,\n\t\"url\": null,\n\t\"notes\": \"A survey of the marine macroalgae and invertebrates
  in the intertidal and subtidal zones was conducted at seven sites around Kaho'olawe
  Island from January 12 to 14, 1998. A total of 298 species were observed or collected,
  including 152 taxa in the intertidal and 193 in the subtidal. Most of these are
  new reports for Kaho'olawe and include only 35 species previously reported, which
  were mostly reef corals and macroalgae. Data are provided as derived from the report:
  1998-002. Coles, S.L., R.C. DeFelice, J.E. Smith, D. Muir & L.G. Eldredge. 1998.
  Determination of baseline conditions for introduced marine species in nearshore
  waters of the of Kaho`olawe, Hawai`i. Report prepared for the Kaho`olaweIsland Reserve
  Commission. 13 + [22] p.http://hbs.bishopmuseum.org/pdf/kahoolawe.pdf\",\n\t\"license_title\":
